/** @format */

import React, { Component } from "react";
import "./App.css";
import logo from '../public/favicon.ico'

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
        <img src="logo" />
    );
  }
}

export default App;
